import React from "react";
import '../css/Home_main.css';

const Home_main = (props) => {
    return (
    <div id='home_main'>
        <h1 class='home_main_header'>국내 최대 수입상용차 부품 공급업체</h1>   
        <h3 class='home_main_text'>엔진에서 작은 볼트 하나까지 부품의 모든 것을 취급합니다.</h3>
    </div>
    )
}

export default Home_main;
